import React, { Componentt} from 'react'

class ComponentProfil extends Component{
    render(){
        const {FullName , bio , profession} = this.props
        return(
            <div>
                <h1>{this.props.FullName}</h1>
                <h3>{this.props.bio}</h3>
                <span>{this.props.profession}</span>
            </div>
        )
    }
}


export default ComponentProfil
